import "./mywork.scss";
import projects from "../projects.json";

export const Work = () => {
    return (
        <div className="mywork">
            <div className="mywork__header"> Projects </div>
            <div>A SUMMARY OF THE PROJECTS I HAVE WORKED ON</div>

            {projects.map((project) => {
                return(
                <div>{project.title}</div>
            )})
            }
        </div>
    )
}
